import fs from 'fs';
import path from 'path';

jest.mock('fs');

export const existsSyncMock = fs.existsSync as jest.MockedFunction<
  typeof fs.existsSync
>;

export const readFileSyncMock = fs.readFileSync as jest.MockedFunction<
  typeof fs.readFileSync
>;

export const readdirSyncMock = fs.readdirSync as jest.MockedFunction<
  typeof fs.readdirSync
>;

export const buildMocks = (fixture: any, basePath: string) => {
  readFileSyncMock.mockImplementation((input) => {
    if ((input as string).endsWith('package.json')) {
      return JSON.stringify(
        (fixture as any).packagejson[path.relative(basePath, input as string)],
      );
    }
    throw new Error(`Input not found in fixture ${input.toString()}`);
  });

  readdirSyncMock.mockImplementation((input) => {
    const result = (fixture as any).nodeModules[
      path.relative(basePath, input as string)
    ];
    if (!result) {
      throw new Error(`Input not found in fixture ${input.toString()}`);
    }
    return result;
  });

  existsSyncMock.mockImplementation((input) => {
    if ((input as string).endsWith('package.json')) {
      return !!(fixture as any).packagejson[
        path.relative(basePath, input as string)
      ];
    } else {
      return !!(fixture as any).nodeModules[
        path.relative(basePath, input as string)
      ];
    }
  });
};

